import { Link } from "react-router-dom"

export default function Navbar(){
    return (
        <nav className="nav">
            
            <Link to="/" className="site-title">
                    <img src="/logo.jpg" alt="Site Logo" className="logo" /></Link>
                <ul>
                    <CustomLink href="/getprediction">Get Prediction</CustomLink>       
                    <CustomLink href="/treatmentoption">Treatment Option</CustomLink>
                    <CustomLink href="/aboutus">About Us</CustomLink>
                </ul>
        </nav>

    )

}

function CustomLink({ href, children, ...props }) {
    const path = window.location.pathname

    return (
        <li className={path === to ? "active" : ""}>
            <Link to={to} {...props}>
            </Link>
        </li>

    )
}
